import React from "react";
const PrintName =() =>{
    return<h1>hello</h1>;
};
function AppName() {
    const user = {
        firstName:"sage",
        secondName:"it",
    };
  return ( 
  <section>
    <h1>hello{new Date().toLocaleTimeString()}</h1>
    <p>this is our company{user.firstName+" "+user.secondName}</p>
    <PrintName/>
    </section>
  );
};
    
    
export default AppName;
